const l=JSON.parse('{"key":"v-23ff5b01","path":"/travel/2023.6.22%20%E6%AD%A6%E6%B1%89.html","title":"2023.6.22 端午武汉游记","lang":"zh-CN","frontmatter":{"title":"2023.6.22 端午武汉游记","date":"2023-06-25T00:00:00.000Z","category":["游记"],"tag":["5A计划"]},"headers":[{"level":2,"title":"行前","slug":"行前","link":"#行前","children":[]},{"level":2,"title":"6.22","slug":"_6-22","link":"#_6-22","children":[{"level":3,"title":"花费","slug":"花费","link":"#花费","children":[]}]},{"level":2,"title":"6.23","slug":"_6-23","link":"#_6-23","children":[{"level":3,"title":"花费","slug":"花费-1","link":"#花费-1","children":[]}]},{"level":2,"title":"6.24","slug":"_6-24","link":"#_6-24","children":[{"level":3,"title":"花费","slug":"花费-2","link":"#花费-2","children":[]}]},{"level":2,"title":"6.25","slug":"_6-25","link":"#_6-25","children":[{"level":3,"title":"花费","slug":"花费-3","link":"#花费-3","children":[]}]},{"level":2,"title":"花费合计：","slug":"花费合计","link":"#花费合计","children":[]}],"git":{"createdTime":1688291611000,"updatedTime":1688291611000,"contributors":[{"name":"fenghao","email":"fenghao9523@gmail.com","commits":1}]},"readingTime":{"minutes":4.89,"words":1467},"filePathRelative":"travel/2023.6.22 武汉.md","localizedDate":"2023年6月25日","excerpt":"<h2> 行前</h2>\\n<p>21年十一的时候去了武功山，结识了一位北京的老哥，30来岁，有家有室，但潇洒自由。他总结了个5A景点目录，已经去了大部分了。我心生向往，向他要了目录，也想着有一天能去掉所有感兴趣的5A。<br>\\n但是吧，因为疫情和拖延症的原因，进展非常缓慢。因此，这个端午决定一定要出去走走，（另外再不请假年假要过期了。再另外，不走在杭州会因为暴雨出不了门）。于是在拖延症的影响以及不知道去哪里的迷茫下，最终拖到了20号的下班班车上，订了来回武汉（5A：黄鹤楼和东湖）的高铁票（6.22-6.25）。</p>\\n<h2> 6.22</h2>\\n<p>动车：15:33 - 20.15<br>\\n由于买票过晚，只有下午的票了，到酒店差不多晚上9点多，并且还没吃晚饭。<br>\\n看住宿地点附近有个“楚河汉街“，据说是美食街景点什么的，就出门找点吃的。结果到了一看，大失所望，既没有什么古风建筑，又没什么美食。随便找了家汉堡店吃了点，草草了事。</p>"}');export{l as data};
